type FinancesMainPageProps = {
  content: MainContent;
};

function FinancesMainPage(props: FinancesMainPageProps) {
  return props.content === MainContent.Main ? (
    <MonthlyFinanceAssigner />
  ) : (
    <div>bye</div>
